import React from "react";

class UpdateMarks extends React.Component {
    constructor(){
        super();
        this.state = {
            val:'nothing'
        }
    }

    render(){
        return(
            <div>
    <button onClick={()=>this.selectCategory('ARRAYS')}>SEM-1</button>
      <button onClick={()=>this.selectCategory('STRINGS')}>SEM-2</button>
      <button onClick={()=>this.selectCategory('STACKS')}>SEM-3</button>
      <button onClick={()=>this.selectCategory('GREEDY')}>SEM-4</button>
      <button onClick={()=>this.selectCategory('DYNAMIC-PROGRAMMING')}>SEM-5</button>
            </div>
        )
    }
}

export default UpdateMarks
